import './button.css';
<h1>Welcome</h1>
function EmButton() {
  return (
    <button className='btn'>
      Emergency
    </button>
  );
}
function LogButton(){
    return (<button className='mtl'>
        Log In
    </button>
    );
}

export default function MyApp() {
  return (
    <div className='first'>

      <EmButton />
        <div className='sec'>
            <LogButton />
        </div>
    </div>
  );
}
